    uint256 public constant MAX_SUPPLY = 210_000_000 * (10 ** 6);
    
    // State variables
    mapping(address => bool) public inWhiteList; // Whitelist for receiving (exempt from buy fees)
    mapping(address => bool) public outWhiteList; // Whitelist for sending (exempt from sell fees)
    uint256 public buyFeeRatio = 0; // Buy fee ratio (basis points, 10000 = 100%)
    uint256 public sellFeeRatio = 500; // Sell fee ratio (basis points, default 5%, 10000 = 100%)
    address public buyFeeAddress; // Address to receive buy fees
    address public burnDividendAddress; // Address for burn/dividend pool (80% of sell fees)
    address public lotteryPoolAddress; // Address for lottery pool (20% of sell fees)
    mapping(address => bool) public swapPairs; // Supported swap pairs (e.g., PancakeSwap)

    // Multisig state variables
    address[] public signers; // List of signers
    uint256 public requiredSignatures; // Required number of signatures
    uint256 public mintProposalCount; // Mint proposal counter
    uint256 public signerChangeProposalCount; // Signer change proposal counter

    // Mint proposal structure
    struct MintProposal {
        address recipient; // Recipient of minted tokens
        uint256 amount; // Amount to mint
        uint256 signatureCount; // Current signature count
        mapping(address => bool) hasSigned; // Signature status
        uint256 deadline; // Proposal deadline
        bool executed; // Whether executed
    }
    mapping(uint256 => MintProposal) public mintProposals; // Mint proposals

    // Signer change proposal structure
    struct SignerChangeProposal {
        address[] newSigners; // New signer list
        uint256 newRequiredSignatures; // New signature threshold
        uint256 signatureCount; // Current signature count
        mapping(address => bool) hasSigned; // Signature status
        uint256 deadline; // Proposal deadline
        bool executed; // Whether executed
    }
    mapping(uint256 => SignerChangeProposal) public signerChangeProposals;

    // Events
