    event ProposalsCleared(uint256[] mintProposalIds, uint256[] signerChangeProposalIds, address indexed clearer);

    // Constructor: Initialize token and multisig
    constructor(
        address _buyFeeAddress,
        address _burnDividendAddress,
        address _lotteryPoolAddress,
        address[] memory _signers,
        uint256 _requiredSignatures
    ) ERC20("Upup Space", "UPP") Ownable(msg.sender) {
        buyFeeAddress = _buyFeeAddress;
        burnDividendAddress = _burnDividendAddress;
        lotteryPoolAddress = _lotteryPoolAddress;
        require(_signers.length >= _requiredSignatures && _requiredSignatures > 0, "Invalid signers or threshold");
        require(_signers.length <= 50, "Too many signers"); // Gas optimization
        for (uint256 i = 0; i < _signers.length; i++) {
            require(_signers[i] != address(0), "Invalid signer address");
            for (uint256 j = i + 1; j < _signers.length; j++) {
                require(_signers[i] != _signers[j], "Duplicate signer");
            }
        }
        signers = _signers;
        requiredSignatures = _requiredSignatures;
        emit SignersUpdated(_signers, _requiredSignatures, msg.sender, block.timestamp);
    }

    // Set decimals to 6
    function decimals() public view virtual override returns (uint8) {
        return 6;
    }

    // Transfer function: Validate destination and apply custom logic
    function transfer(address to, uint256 amount) public override returns (bool) {
        require(to != address(0) && to != address(this), "Invalid destination");
        _customTransfer(msg.sender, to, amount);
        return true;
    }

    // TransferFrom function: Validate destination and apply custom logic
    function transferFrom(address from, address to, uint256 amount) public override returns (bool) {
        require(to != address(0) && to != address(this), "Invalid destination");
        _spendAllowance(from, msg.sender, amount); // Deduct allowance
        _customTransfer(from, to, amount);         // Perform transfer with fees
        return true;
    }

    // Custom transfer function: Handle fees
    function _customTransfer(address sender, address recipient, uint256 amount) internal {
        require(amount > 0, "Amount must be greater than 0");
        uint256 totalFee = 0;
        if (!outWhiteList[sender] && !inWhiteList[recipient]) {
            if (swapPairs[recipient] && sellFeeRatio > 0) {
                // Sell: Adjustable fee (default 5%, set by Owner)
                uint256 burnDividendFee = 0;
                uint256 lotteryFee = 0;
                if (burnDividendAddress != address(0) || lotteryPoolAddress != address(0)) {
                    totalFee = (amount * sellFeeRatio) / 10000;
                    if (burnDividendAddress != address(0)) {
                        burnDividendFee = (totalFee * 80) / 100;
                        super._transfer(sender, burnDividendAddress, burnDividendFee);
                    }
                    if (lotteryPoolAddress != address(0)) {
                        lotteryFee = (totalFee * 20) / 100;
                        super._transfer(sender, lotteryPoolAddress, lotteryFee);
                    }
                }
                emit SellFeeApplied(sellFeeRatio, burnDividendFee, lotteryFee);
            } else if (swapPairs[sender] && buyFeeAddress != address(0) && buyFeeRatio > 0) {
                // Buy: Fixed fee
                totalFee = (amount * buyFeeRatio) / 10000;
                super._transfer(sender, buyFeeAddress, totalFee);
            }
        }
        amount -= totalFee;
        super._transfer(sender, recipient, amount);
    }

    // Propose minting new tokens
    function proposeMint(address recipient, uint256 value) external returns (uint256) {
        require(recipient != address(0), "Invalid recipient");
        require(isSigner(msg.sender), "Not a signer");
        uint256 amount = value * (10 ** decimals());
        require(totalSupply() + amount <= MAX_SUPPLY, "Minting exceeds max supply");

        uint256 proposalId = mintProposalCount++;
        MintProposal storage proposal = mintProposals[proposalId];
        proposal.recipient = recipient;
        proposal.amount = amount;
        proposal.signatureCount = 1;
        proposal.hasSigned[msg.sender] = true;
        proposal.deadline = block.timestamp + 3 days; // 3-day validity
        proposal.executed = false;

        emit MintProposed(proposalId, recipient, amount, proposal.deadline);
        return proposalId;
    }

    // Sign mint proposal
    function signMintProposal(uint256 proposalId) external {
        require(proposalId < mintProposalCount, "Invalid proposal ID");
        MintProposal storage proposal = mintProposals[proposalId];
        require(!proposal.executed, "Proposal already executed");
        require(block.timestamp <= proposal.deadline, "Proposal expired");
        require(isSigner(msg.sender), "Not a signer");
        require(!proposal.hasSigned[msg.sender], "Already signed");

        proposal.hasSigned[msg.sender] = true;
        proposal.signatureCount++;
        emit MintSigned(proposalId, msg.sender);
    }

    // Execute mint proposal (restricted to signers or owner)
    function executeMint(uint256 proposalId) external {
        require(isSigner(msg.sender) || msg.sender == owner(), "Not a signer or owner");
        require(proposalId < mintProposalCount, "Invalid proposal ID");
        MintProposal storage proposal = mintProposals[proposalId];
        require(!proposal.executed, "Proposal already executed");
        require(block.timestamp <= proposal.deadline, "Proposal expired");
        require(proposal.signatureCount >= requiredSignatures, "Insufficient signatures");

        proposal.executed = true;
        _mint(proposal.recipient, proposal.amount);
        emit MintExecuted(proposalId, proposal.recipient, proposal.amount);
    }

    // Propose signer change
    function proposeSignerChange(address[] memory _newSigners, uint256 _newRequiredSignatures) external returns (uint256) {
        require(isSigner(msg.sender), "Not a signer");
        require(_newSigners.length >= _newRequiredSignatures, "Signers count less than required signatures");
        require(_newRequiredSignatures > 0, "Required signatures must be greater than 0");
        require(_newSigners.length <= 50, "Too many signers"); // Gas optimization
        for (uint256 i = 0; i < _newSigners.length; i++) {
            require(_newSigners[i] != address(0), "Invalid signer address");
            for (uint256 j = i + 1; j < _newSigners.length; j++) {
                require(_newSigners[i] != _newSigners[j], "Duplicate signer");
            }
        }

        uint256 proposalId = signerChangeProposalCount++;
        SignerChangeProposal storage proposal = signerChangeProposals[proposalId];
        proposal.newSigners = _newSigners;
        proposal.newRequiredSignatures = _newRequiredSignatures;
        proposal.signatureCount = 1;
        proposal.hasSigned[msg.sender] = true;
        proposal.deadline = block.timestamp + 3 days; // 3-day validity
        proposal.executed = false;

        emit SignerChangeProposed(proposalId, _newSigners, _newRequiredSignatures, proposal.deadline);
        return proposalId;
    }

    // Sign signer change proposal
    function signSignerChangeProposal(uint256 proposalId) external {
        require(proposalId < signerChangeProposalCount, "Invalid proposal ID");
        SignerChangeProposal storage proposal = signerChangeProposals[proposalId];
        require(!proposal.executed, "Proposal already executed");
        require(block.timestamp <= proposal.deadline, "Proposal expired");
        require(isSigner(msg.sender), "Not a signer");
        require(!proposal.hasSigned[msg.sender], "Already signed");

        proposal.hasSigned[msg.sender] = true;
        proposal.signatureCount++;
        emit SignerChangeSigned(proposalId, msg.sender);
    }

    // Execute signer change proposal
    function executeSignerChange(uint256 proposalId) external {
        require(proposalId < signerChangeProposalCount, "Invalid proposal ID");
        SignerChangeProposal storage proposal = signerChangeProposals[proposalId];
        require(!proposal.executed, "Proposal already executed");
        require(block.timestamp <= proposal.deadline, "Proposal expired");
        require(proposal.signatureCount >= requiredSignatures, "Insufficient signatures");

        signers = proposal.newSigners;
        requiredSignatures = proposal.newRequiredSignatures;
        proposal.executed = true;
        emit SignerChangeExecuted(proposalId, proposal.newSigners, proposal.newRequiredSignatures);
    }

    // Owner updates signers and threshold (add, remove, modify signers)
    function setSignersAndThreshold(address[] memory _signers, uint256 _requiredSignatures) external onlyOwner {
        require(_signers.length >= _requiredSignatures, "Signers count less than required signatures");
        require(_requiredSignatures > 0, "Required signatures must be greater than 0");
        require(_signers.length <= 50, "Too many signers"); // Gas optimization
        for (uint256 i = 0; i < _signers.length; i++) {
            require(_signers[i] != address(0), "Invalid signer address");
            for (uint256 j = i + 1; j < _signers.length; j++) {
                require(_signers[i] != _signers[j], "Duplicate signer");
            }
        }
        signers = _signers;
        requiredSignatures = _requiredSignatures;
        emit SignersUpdated(_signers, _requiredSignatures, msg.sender, block.timestamp);
    }

    // Clear expired proposals
    function clearExpiredProposals(uint256[] calldata mintProposalIds, uint256[] calldata signerChangeProposalIds) external {
        require(msg.sender == owner() || isSigner(msg.sender), "Not owner or signer");
        
        // Clear mint proposals
        for (uint256 i = 0; i < mintProposalIds.length; i++) {
            uint256 proposalId = mintProposalIds[i];
            require(proposalId < mintProposalCount, "Invalid mint proposal ID");
            MintProposal storage proposal = mintProposals[proposalId];
            require(block.timestamp > proposal.deadline, "Proposal not expired");
            require(!proposal.executed, "Proposal already executed");
            delete mintProposals[proposalId];
        }

        // Clear signer change proposals
        for (uint256 i = 0; i < signerChangeProposalIds.length; i++) {
            uint256 proposalId = signerChangeProposalIds[i];
            require(proposalId < signerChangeProposalCount, "Invalid signer change proposal ID");
            SignerChangeProposal storage proposal = signerChangeProposals[proposalId];
            require(block.timestamp > proposal.deadline, "Proposal not expired");
            require(!proposal.executed, "Proposal already executed");
            delete signerChangeProposals[proposalId];
        }

        emit ProposalsCleared(mintProposalIds, signerChangeProposalIds, msg.sender);
    }

    // Set buy fee ratio (max 1%)
    function setBuyFeeRatio(uint256 ratio) external onlyOwner {
        require(ratio <= 100, "Fee ratio exceeds 1%");
        buyFeeRatio = ratio;
        emit FeeRatioChanged(buyFeeRatio);
    }

    // Set sell fee ratio (max 10%)
    function setSellFeeRatio(uint256 ratio) external onlyOwner {
        require(ratio <= 1000, "Sell fee ratio exceeds 10%");
        sellFeeRatio = ratio;
        emit SellFeeRatioChanged(sellFeeRatio);
    }

    // Add swap pair
    function addSwapPair(address _pair) external onlyOwner {
        require(_pair != address(0), "Invalid address");
        swapPairs[_pair] = true;
        emit SwapPairChanged(_pair, true);
    }

    // Remove swap pair
    function removeSwapPair(address _pair) external onlyOwner {
        require(_pair != address(0), "Invalid address");
        swapPairs[_pair] = false;
        emit SwapPairChanged(_pair, false);
    }

    // Set fee addresses
    function setFeeAddresses(
        address _buyFeeAddress,
        address _burnDividendAddress,
        address _lotteryPoolAddress
    ) external onlyOwner {
        buyFeeAddress = _buyFeeAddress;
        burnDividendAddress = _burnDividendAddress;
        lotteryPoolAddress = _lotteryPoolAddress;
        emit FeeAddressChanged(_buyFeeAddress, _burnDividendAddress, _lotteryPoolAddress);
    }

    // Batch add receive whitelist
    function setMultipleInWhiteList(address[] calldata addresses) external onlyOwner {
        for (uint256 i = 0; i < addresses.length; i++) {
            require(addresses[i] != address(0), "Invalid address");
            inWhiteList[addresses[i]] = true;
            emit SetWhiteList(addresses[i]);
        }
        emit MultipleWhiteListSet(addresses, true, false);
    }

    // Batch remove receive whitelist
    function removeMultipleInWhiteList(address[] calldata addresses) external onlyOwner {
        for (uint256 i = 0; i < addresses.length; i++) {
            require(addresses[i] != address(0), "Invalid address");
            inWhiteList[addresses[i]] = false; 
            emit RemoveWhiteList(addresses[i]);
        }
        emit MultipleWhiteListSet(addresses, false, false);
    }

    // Batch add send whitelist
    function setMultipleOutWhiteList(address[] calldata addresses) external onlyOwner {
        for (uint256 i = 0; i < addresses.length; i++) {
            require(addresses[i] != address(0), "Invalid address");
            outWhiteList[addresses[i]] = true;
            emit SetWhiteList(addresses[i]);
        }
        emit MultipleWhiteListSet(addresses, false, true);
    }

    // Batch remove send whitelist
    function removeMultipleOutWhiteList(address[] calldata addresses) external onlyOwner {
        for (uint256 i = 0; i < addresses.length; i++) {
            require(addresses[i] != address(0), "Invalid address");
            outWhiteList[addresses[i]] = false;
            emit RemoveWhiteList(addresses[i]);
        }
        emit MultipleWhiteListSet(addresses, false, false);
    }

    // Helper function: Check if address is a signer
    function isSigner(address _address) private view returns (bool) {
        for (uint256 i = 0; i < signers.length; i++) {
            if (signers[i] == _address) {
                return true;
            }
        }
        return false;
    }
